import React from "react";
import Swal from "sweetalert2";
import { Token } from "../../../Api/Token/token";
import ApiUrl from "../../../Api/Urls/api_urls";


class GoogleLoginAuthentication extends React.Component {

    constructor(props) {
        super(props)
        this.state = {
            name: "",
            email: "",
            provider_id: "",
            provider_type: "google",
            image: ""
        }
    }


    signIn = () => {
        const ga = window.gapi.auth2.getAuthInstance();
        ga.signIn().then(
            googleUser => {
                //  console.log("googleUser===>", googleUser)
                this.getAWSCredentials(googleUser);
            },
            error => {
                console.log(error);
            }
        );
    }

    getAWSCredentials = (googleUser) => {
        // console.log("googleUser===>", googleUser)
        // this.props.action.googleLoginAuthentication(googleUser);
        let first_name = googleUser.Qt.vW;
        let last_name = googleUser.Qt.wU;
        let name = first_name + last_name;
        let provider_id = googleUser.Qt.SU;
        let email = googleUser.Qt.zu;
        // let image = googleUser.Qt.UK;
        // let name = first_name + last_name;
        this.setState({
            name,
            provider_id,
            email,
            // image
        })

        this.onClickGoogle();
    }

    onClickGoogle = async term => {
        const { name, email, provider_id, provider_type, image } = this.state;
        Swal.fire({
            title: 'Loading...',
            html: '',
            allowOutsideClick: false,
            onBeforeOpen: () => {
                Swal.showLoading()
                // window.location.reload()
            }
        })
        const response = await Token.WITHOUT_TOKEN.post(ApiUrl.SOCIAL_AUTH, {
            name: name,
            email: email,
            provider_id: provider_id,
            provider_type: provider_type,
            image: image
        })
        // console.log("QWERTYU Before", response)
        if (response.data.code === 200) {
            // console.log("QWERTYU After", response)
            localStorage.setItem("token", response.data.result.sessionToken)
            window.location = "home";
        }
        Swal.close()


    }

    createScript() {
        // load the Google SDK
        const script = document.createElement("script");
        script.src = "https://apis.google.com/js/platform.js";
        script.async = true;
        script.onload = this.initGapi;
        document.body.appendChild(script);
    }

    initGapi() {
        // init the Google SDK client
        const g = window.gapi;

        // console.log("a===>", g)
        g.load("auth2", function () {
            g.auth2.init({
                client_id:
                    "571417961310-svapabdv4mq5hulnv4lojgcofhd07bpv.apps.googleusercontent.com",
                scope: "profile email openid"
            });
        });
    }

    render() {
        return (
            <React.Fragment>
                <button onClick={this.signIn}>SignIn</button>
            </React.Fragment>
        )
    }
}

export default GoogleLoginAuthentication;
